import React from 'react'
import {
    Switch,
    Route,
} from "react-router-dom";

export default function SwitchComp() {
    return (
        <Switch>

            <Route path="/contentdatas">
                <ContentDatas />
            </Route>
            <Route path="/comments">
                <Comments />
            </Route>
            <Route path="/contacts">
                <Contacts />
            </Route>
            <Route path="/useradmin">
                <UserAdmin />
            </Route>
            <Route path="/errors">
                <Errors />
            </Route>

        </Switch>
    )
}

function Home() {
    return <h2>Home</h2>;
}
function ContentDatas() {
    return <h2>ContentData</h2>;
}

function Comments() {
    return <h2>Comment</h2>;
}

function Contacts() {
    return <h2>Contact</h2>;
}
function Errors() {
    return <h2>ErrorCatch</h2>;
}
function UserAdmin() {
    return <h2>User</h2>;
}
